  01> WILLIAMS, Rebecca Letty
  b 03.03.1998
  Rebecca b. at Hastings.
  02> WILLIAMS, Donald Hume
  b 21.11.1966
  Donald b. at Te Puia Springs. Address: 12 Governor Road, Northland, Wellington.
  Donald was educated at Hereworth School (1976-79) and was in the 1st rugby XV, the 1st cricket XI,
  the 1st hockey XI and was Head Prefect. He went on to St Paul's Collegiate School in Hamilton
  where he was Head of House, in the 1st cricket XI for three years and captain, and in the 1st rugby
  XV for two years and captain. After four years overseas, he took a management course at Wellington
  Polytechnic and he is now working for Telecom NZ as an accounts manager.
  03> WILLIAMS, Matthew Stuart
  b 23.12.1968
  Matthew b. at Te Puia Springs. Address: 45 Norfolk Road, Ponsonby, Auckland.
  Matthew was educated at Hereworth School where he was a prefect. He went on to St Paul's
  Collegiate in Hamilton and was a house prefect and in the 1st hockey XI. He received a major music
  award and went to university where he graduated BMus. He now works for a publisher in Auckland,
  02> WILLIAMS, Simon Dow
  b 19.09.1935
  Simon b. at Gisborne. Address: 126 Ann Street, Rotorua.
  Simon was educated at Hereworth School (1944-48) and Christ's College, Christchurch, (1949-53). After
  a short spell at farming he became a truck operator at Te Awamutu. He sold that business and took on
  agricultural contracting at Ruatoria on the East Coast. That business was also sold and he now lives
  in Rotorua and works for a hire company.
  03> WILLIAMS, Philippa Anne m on 08.04.1964 to BROAD, Kim Lowther
  b 29.03.1939
  b 03.05.1937
  Philippa b. at Gisborne and m, at Holy Trinity Church, Gisborne. Kim, s/o John Lowther Broad and
  Prudence Morris Reynolds. Address: "Tunaiti" Station, Waimata Valley, Private Bag, Gisborne.
  Philippa is a NZ registered nurse and Kim is a farmer.
  01> BROAD, Anna Morris m on 18.12.1992 to NEEDHAM, Reece
  b 26.08.1965
  b 22.09.1963
  Address: 70 Riverside Road, Gisborne.
